import React, { Component } from 'react';
import { StyleSheet, Text, View } from 'react-native';

export default function ReviewDetails( {route}){
  const {title} = route.params
  return(
    <View>
      <Text>{ title }</Text>
    </View>
  )
}

const styles = StyleSheet.create({
  screen: {
    flex: 1
  }
})
